import React from 'react';
import { Col, Row } from 'antd';
import Navbar from '../components/Navbar';

function Boleteria() {
  const rectangleStyle = {
    width: '300px', // Ancho del rectángulo
    height: '200px', // Alto del rectángulo
    backgroundColor: '#1890ff', // Color del rectángulo
    borderRadius: '8px', // Bordes redondeados opcionales
    margin: '0 auto', // Centrar el rectángulo horizontalmente
  };

  return (
    <div className="background" style={{ minHeight: '100vh', padding: '20px' }}>
      <Row>
        <Col xs={24}>
          <Navbar />
        </Col>
      </Row>
      <Row justify="center" align="middle" style={{ flex: 1 }}>
        <Col>
          <div style={rectangleStyle} />
        </Col>
      </Row>
      <Row>
        <Col xs={24}>
          {/* Este espacio se mantiene vacío si es necesario */}
        </Col>
      </Row>
    </div>
  );
}

export default Boleteria;
